// @mui material components
import Card from "@mui/material/Card";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";

import Grid from "@mui/material/Grid";
// import { Table } from 'react-bootstrap';
// Data
// import { Link } from "react-router-dom";
import datatable from "layouts/authentication/error/datatable";
// import datatable1 from "layouts/authentication/error/datatable1";
import datatable2 from "layouts/authentication/error/datatable2";


function DataTables() {

  const Columns =
  {

    column: [
      { Header: "InvestorName", accessor: "InvestorName", width: "30%" },
      { Header: "Location", accessor: "Location", width: "30%" },
      { Header: "Investments", accessor: "Investments", width: "30%" },

    ],

    rows: [
      {
        InvestorName: "ANAND KUMAR SABOO",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },

      {
        InvestorName: "KANTA RATHI",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "Anil Kumar Rathi",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "RAJIV TAPARIA",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "KHUSHBOO TAPARIA BEDI",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "ANAND KUMAR SABOO",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "RANJAN JAISWAL",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "ANAND KUMAR SABOO",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "Subhash Poddar",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },
      {
        InvestorName: "ANAND KUMAR SABOO",
        Location: "BENGALURU",
        Investments: "3,93,06,271",
      },

      {
        name: "Hamil Cicci",
        position: "Programmer Analyst IV",
        office: "Fukushima-shi",
        age: 34,
        startDate: "10/7/2020",
        salary: "$471,172",
      },
      {
        name: "Stormie Peacop",
        position: "GIS Technical Architect",
        office: "Emiliano Zapata",
        age: 57,
        startDate: "10/21/2020",
        salary: "$217,522",
      },
      {
        name: "Kayle Fallon",
        position: "Technical Writer",
        office: "Midleton",
        age: 19,
        startDate: "12/10/2020",
        salary: "$294,275",
      },
      {
        name: "Cassandre Watters",
        position: "Technical Writer",
        office: "Karang Tengah",
        age: 21,
        startDate: "7/31/2021",
        salary: "$213,508",
      },
      {
        name: "Cobb Fish",
        position: "VP Product Management",
        office: "General Elizardo Aquino",
        age: 60,
        startDate: "8/27/2020",
        salary: "$201,191",
      },
    ],

  };


  return (
    <DashboardLayout>
      <DashboardNavbar />

      <SuiBox p={3} style={{ backgroundColor: ' #EFFFFD', borderRadius: '15px', marginTop: "10px" }} >
        <Grid container spacing={3} alignItems="center">
          <Grid item>
            <SuiBox height="100%" mt={0.5} lineHeight={2}>
              <SuiTypography variant="h4" fontWeight="bold" style={{ color: "black", textAlign: 'center' }}>
                Overall Dashboard
              </SuiTypography>
            </SuiBox>
          </Grid>
        </Grid>
      </SuiBox>

      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Card style={{ backgroundColor: ' #D9F8C4' }}>
            <SuiBox p={2}>
              <Grid container spacing={3}>
                <Grid item xs={6} lg={2.3}>

                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total AUM" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>

                </Grid>

                <Grid item xs={6} lg={2.3}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total Purchase" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>

                <Grid item xs={6} lg={2.4}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total Redemption" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>

                <Grid item xs={6} lg={2.3}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total Clients" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>

                <Grid item xs={6} lg={2.7}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Running SIPs At Bse" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>
              </Grid>
            </SuiBox>
          </Card>
        </SuiBox>
      </SuiBox>


      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Card style={{ backgroundColor: ' #BCFFB9' }}>
            <SuiBox p={2}>
              <SuiBox p={3} lineHeight={1}>
                <SuiTypography variant="h5" fontWeight="medium">
                  TOP INVESTORS AUM
                </SuiTypography>
              </SuiBox>
              <DataTable table={Columns} canSearch />
            </SuiBox>
          </Card>
        </SuiBox>
      </SuiBox>

      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Card style={{ backgroundColor: ' #F5FDB0' }}>
            <SuiBox p={2}>
              <SuiBox p={3} lineHeight={1}>
                <SuiTypography variant="h5" fontWeight="medium">
                  TOP AMC AUM
                </SuiTypography>
              </SuiBox>
              <DataTable table={datatable} canSearch />
            </SuiBox>
          </Card>
        </SuiBox>
      </SuiBox>


      <SuiBox pt={6} pb={3}>
        <Card style={{ backgroundColor: ' #F7E6AD' }}>
          <SuiBox p={4} lineHeight={1}>
            <SuiTypography variant="h5" fontWeight="medium">

              CURRENT MONTH SNAPSHOT
            </SuiTypography>

          </SuiBox>
          <DataTable table={datatable2} canSearch />
        </Card>

      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default DataTables;
